Three artists are currently referred to as Tiger Stripes.  1. Tiger Stripes is one of the names used by Swedish producer and instrumentalist Mikael Nordgren (his other aliases include D'Malicious and 12th Floor). He is very flexible; he plays everything from heavy tech house to soft garage and disco.
 The debut mix of Tiger Stripes was &quot;Dingo.&quot;    
 2. Tiger Stripes is an indie band from Adelaide, Australia. - Changed name to Mad Shapes

Jan Johnston (born February 21, 1965 in Salford, Lancashire, England) is an English female singer. In the early 1990s she was signed to Columbia Records as part of the pop duo JJ. However when this project failed she changed musical genres and started appearing on many dance and trance releases, mostly on the Perfecto Records label. Her voice is featured in some of Brian Transeau's and many other trance music producer titles.  Discography:  JJ:  Albums:
